import React from 'react';

const NotificationCartIcon = ({ count }) => {
  return (
    <div className="notification-cart-icon">
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width="24"
        height="24"
        viewBox="0 0 24 24"
      >
        <path d="M0 0h24v24H0z" fill="none" />
        <path
          fill="currentColor"
          d="M21 6H7.414l2.293-2.293A.996.996 0 0 0 9 3H3a1 1 0 0 0 0 2h4.586l-2.293 2.293A.996.996 0 0 0 5 9h6a1 1 0 0 0 .707-.293L7.414 6H21a1 1 0 0 0 0-2zM5 21a3 3 0 0 0 3 3h8a3 3 0 0 0 3-3H5z"
        />
      </svg>
      {count > 0 && <span className="notification-count">{count}</span>}
    </div>
  );
};

export default NotificationCartIcon;
